import React, { useEffect } from "react";
import "../Layout.css";

function Home() {
  useEffect(() => {
    if (!window.FB) {
      window.fbAsyncInit = function() {
        window.FB.init({ xfbml: true, version: "v16.0" });
      };
      ((d, s, id) => {
        let js, fjs = d.getElementsByTagName(s)[0];
        if (d.getElementById(id)) return;
        js = d.createElement(s); js.id = id;
        js.src = "https://connect.facebook.net/sv_SE/sdk.js";
        fjs.parentNode.insertBefore(js, fjs);
      })(document, "script", "facebook-jssdk");
    } else { window.FB.XFBML.parse(); }
  }, []);

  return (
    <div className="page-container">
      <div className="outer-card">
        <h1>Kumla Sportfiskeförening</h1>
        <h2>Välkommen!</h2>

        <div className="inner-card">
          <div style={{ display: "flex", gap: "20px", flexWrap: "wrap" }}>
            <div style={{ flex: 1, minWidth: "300px", maxWidth: "720px" }}>
              <p style={{ fontWeight: 600, wordWrap: "break-word", overflowWrap: "break-word" }}>
                Välkomna till Kumla Sportfiskeförening och Säbylundssjön! Säbylundssjön är en lättillgänglig familjesjö med spinn, mete och flugfiske.
              </p>
            </div>
            <div style={{ flex: "0 0 340px" }}>
              <div className="fb-page"
                   data-href="https://www.facebook.com/KumlaSportfiske/"
                   data-tabs="timeline"
                   data-width="340"
                   data-height=""
                   data-small-header="false"
                   data-adapt-container-width="true"
                   data-hide-cover="false"
                   data-show-facepile="true">
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Home;
